import React, { useEffect, useState } from "react";
import { Fragment } from "react";
import { getTests } from "../actions/productActions";
import { useDispatch, useSelector } from "react-redux";
import { useLocation, useNavigate } from "react-router-dom";

const Test = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const dispatch = useDispatch();
  
  // Fetch tests from Redux store
  const { tests, loading } = useSelector((state) => state.tests);

  const selectedTest = location.state?.selectedTest || "CDS";
  
  useEffect(() => {
    if (!location.state?.selectedTest) {
      navigate("/");
    } else {
      dispatch(getTests(selectedTest));
      window.scrollTo(0, 0);
    }
  }, [dispatch, selectedTest, navigate, location.state]);

  // State for user answers
  const [currentQuestionIndex, setCurrentQuestionIndex] = useState(0);
  const [userAnswers, setUserAnswers] = useState({});
  
  // Get the current question
  const currentQuestion = tests?.[0]?.questions[currentQuestionIndex];

  // Handle answer selection
  const handleOptionSelect = (questionId, option) => {
    setUserAnswers((prev) => ({
      ...prev,
      [questionId]: option,
    }));
  };

  // Handle next question
  const handleNext = () => {
    if (currentQuestionIndex < tests?.[0]?.questions.length - 1) {
      setCurrentQuestionIndex((prev) => prev + 1);
    }
  };

  // Handle previous question
  const handlePrevious = () => {
    if (currentQuestionIndex > 0) {
      setCurrentQuestionIndex((prev) => prev - 1);
    }
  };

  // Handle test submission
  const handleSubmit = () => {
    console.log("Submitting Test:", userAnswers);
    // Send userAnswers to the backend for evaluation
  };

  return (
    <Fragment>
      <div className="test-body">
        {loading ? (
          <p>Loading test...</p>
        ) : tests.length > 0 ? (
          <>
            <div className="test-head">
              <div className="test-name">
                <p>{tests[0]?.title} Full Test</p>
              </div>
              <div className="timeleft">
                <p>Time left 00:00:00</p>
              </div>
              <div className="full-button">
                <button>Enter Full Screen</button>
              </div>
            </div>

            <div className="test-content">
              <div className="test-section">
                <div className="ques">
                  <p>Question No. {currentQuestionIndex + 1}</p>
                </div>
                <div className="section-marks">
                  <div className="correct">
                    <p>Correct</p>
                    <p>+{tests[0]?.marksCorrect}</p>
                  </div>
                  <div className="incorrect">
                    <p>Incorrect</p>
                    <p>-{tests[0]?.marksWrong}</p>
                  </div>
                </div>
              </div>

              {currentQuestion && (
                <div className="test-question">
                  <div className="question">
                    <p>{currentQuestion.questionText}</p>
                  </div>
                  <div className="test-options">
                    {currentQuestion.options.map((option, index) => (
                      <div key={index}>
                        <label>
                          <input
                            type="radio"
                            name={`question-${currentQuestion._id}`}
                            value={option}
                            checked={userAnswers[currentQuestion._id] === option}
                            onChange={() => handleOptionSelect(currentQuestion._id, option)}
                          />
                          <span>{option}</span>
                        </label>
                      </div>
                    ))}
                  </div>
                </div>
              )}
            </div>

            <div className="test-submit">
              <div className="test-save">
                <button onClick={handlePrevious} disabled={currentQuestionIndex === 0}>
                  Previous Question
                </button>
                <button onClick={handleNext} disabled={currentQuestionIndex === tests[0]?.questions.length - 1}>
                  Save & Next
                </button>
              </div>
              <div className="test-save">
                <button className="submit-btn" onClick={handleSubmit}>
                  Submit
                </button>
              </div>
            </div>
          </>
        ) : (
          <p>No tests available</p>
        )}
      </div>
    </Fragment>
  );
};

export default Test;
